import React from "react";
import Starter from "./Starter";
import Package from "./Package";

const Pricing = () =>{
    const check = {
        color: "#154B69"

    }
    const bgWhite = {
        background : "#FFF"
    }
    const blur = {
        color : "#959497"
    }
    const bgBlue ={
        background : "#154B69",
        color : "white"
    }
    return(
        <section className="Pricing_features">
        <div className="container">
        <Starter 
                starter_heading="Pricing plan"
                starter_heading_2 = "Pricing plan"
            />
        <div className="row ">
        <Package 
            check={check}
            bgColor = {bgWhite}
            blur ={blur}
        />
        <Package 
            check={check}
            bgColor = {bgBlue}
            blur ={blur}
        />


        </div>
        </div>
        

        </section>

    )
}

export default Pricing;
